  name: SymDocument
  nameWithType: SymDocument
  fullName: System.Diagnostics.SymbolStore.SymDocument
  type: Class
  summary: "Represents a document referenced by a symbol store."
  remarks: "A document is defined by a URL and a document type GUID. Using the document type GUID and the URL, you can locate the document. You can optionally store document source in the symbol store.       This interface also provides access to that source, if present."
  syntax:
